"use strict";

import SvgIcon from "../../SvgIcon";
import { incomplete } from "../../svgDefinitions";

/**
 * The Incomplete icon class constructor
 * @class Incomplete
 * @extends SvgIcon
 */
export default class Incomplete extends SvgIcon {
    /**
     * @inheritDoc
     */
    get _name() {
        return "Incomplete";
    }

    /**
     * @inheritDoc
     */
    initialProps() {
        const props = super.initialProps();
        return Object.assign(props, {
            defaultClassNames: `${props.defaultClassNames} mpageui-SvgIcon-status-incomplete`
        });
    }

    /**
     * @inheritDoc
     */
    getSvg() {
        return incomplete;
    }
}
